import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const administracionRoutes: Routes = [
  {path:'',
    children:[
      {path:'administracion',
      loadChildren: () => import
      ('./cajas/cajas.module').then(m => m.CajasModule)},
      {path:'administracion',
      loadChildren: () => import
      ('./categorias/categorias.module').then(m => m.CategoriasModule)},
      {path:'administracion',
      loadChildren: () => import
      ('./proveedores/proveedores.module').then(m => m.ProveedoresModule)},
      {path:'administracion',
      loadChildren: () => import
      ('./usuarios/usuarios.module').then(m => m.UsuariosModule)},
      {path:'administracion',
      loadChildren: () => import
      ('./clientes/clientes.module').then(m => m.ClientesModule)},
    ]
  }
]

@NgModule({
  imports: [
    RouterModule.forChild(administracionRoutes)
  ],
  exports:[
    RouterModule
  ]
})
export class AdministracionRoutingModule { }
